import './App.css';
import React from 'react'
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Home from './Pages/Home';



const MyRoutes = () => {
  return (
    <BrowserRouter>
    <Routes>
    <Route exact path="/" component={<Home/>} />

    </Routes>

    </BrowserRouter>
  )
}

export default MyRoutes
